import React from "react";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
// import styles from "../modules/Catogory.module.css";
import TldCategoryList from "./TldCategoryList.js";
import Emojis from "./Emojis.js";
import Names from "./Names.js";
import ThreeLetter from "./ThreeLetter.js";
import TwoLetter from "./TwoLetter.js";
import TopPicks from "./TopPicks.js";

export default function Catogory() {
  return (
    <Router className={styles.container}>
      <Switch>
        <Route path="/" exact component={TldCategoryList} />
        <Route path="/emojis" component={Emojis} />
        <Route path="/topPicks" component={TopPicks} />
        <Route path="/names" component={Names} />
        <Route path="/threeLetter" component={ThreeLetter} />
        <Route path="/twoLetter" component={TwoLetter} />
      </Switch>
    </Router>
  );
}
